@Component({
  selector: 'app-not-found-page',
  templateUrl: './not-found-page.component.html',
  styleUrls: ['./not-found-page.component.scss']
})
export class NotFoundPageComponent {

}
<div
  id="not-found-page"
  class="d-flex justify-content-center align-items-center"
>
